import React, { PureComponent } from 'react';

class MemberState extends Component {
    state = { 
        data: [
            {id: 1, name: "Rithy THUL", position: "PR and Partnership", image: "img/team/rithy.png"},
            {id: 2, name: "Sela THUL", position: "Linux Developer", image: "img/team/sela.png"},
            {id: 3, name: "Saing SAB", position: "Kernel Developer", image: "img/team/saing.png"},
            {id: 4, name: "Vuthy SAN", position: "Full Stack Developer", image: "img/team/vuthy.png"},
            {id: 5, name: "Panha YOU", position: "Sale & Marketing Manager", image: "img/team/panha_you.png"},
        ]
     }
    render() { 
        return ( 
            this.state.data.map(p =>{
                <div className="column">
                    <div>
                    <center>
                        <img
                        src={p.image}
                        className="ui fluid image teamImage"
                        />
                        <h3 className="memberName">{p.name}</h3>
                        <p className="memberPosition">{p.position}</p>
                    </center>
                    </div>
                </div>
            })
         );
    }
}

export default MemberState;
